import Timer from "./timer";
import React from "react";
import {useNavigate} from "react-router-dom";

const buttonNames = [
    'Seizure',
    'Heart Attack',
    'Stroke',
    'Choke',
    'Diabetes',
    'Blood',
    'Asthma',
    'Broken Bones',
];

const buttonImages = [
    'url(seizure-image-url)',
    'url(heart-attack-image-url)',
    'url(stroke-image-url)',
    'url(choke-image-url)',
    'url(diabetes-image-url)',
    'url(blood-image-url)',
    'url(asthma-image-url)',
    'url(broken-bones-image-url)',
];
function HandleClick() {

}

export function ButtonContainer() {
    const navigation = useNavigate();
    const buttons = buttonNames.map((name, index) => (
        <button key={index} className="button" onClick={()=>navigation('/'+name.toLowerCase().replace(/\s+/g, '-'))}>
            {name}
        </button>
    ));

    return (
            <div className="button-container">
                {buttons}
                <div className="emergency-container">
                    <button className="emergency-button">Et </button>
                </div>
                <Timer/>
            </div>
    );
}

export default ButtonContainer;
